/** @format */

import React, { useEffect, useState } from 'react';

function ResetPassword(props) {
	const [password, setPassword] = useState('');
	const [confirmPassword, setConfirmPassword] = useState('');

	const isValid = () => {
		if (password !== confirmPassword) {
			return;
		}
	};
	const submitHandler = (e) => {
		e.preventDefault();
	};

	return (
		<>
			<div className="container">
				<div className="row">
					<div className="col-md-6">
						<div className="row">
							<div className="col-md-2"></div>
							<div className="col-md-8">
								<div className="passcontainer">
									<h4 className="bold">Reset your password</h4>
									<p className="">Change your password</p>

									<form className="" onSubmit={submitHandler}>
										<div className="form-group">
											<label htmlFor="exampleInputPassword1">Password</label>
											<input type="password" className="form-control" id="exampleInputPhone" placeholder="New password" onChange={(e) => setPassword(e.target.value)} required />
										</div>
										<div className="form-group">
											<label htmlFor="exampleInputPassword1">Confirm Password</label>
											<input
												type="password"
												className="form-control"
												id="exampleInputPhone"
												placeholder="Confirm new password"
												onChange={(e) => setConfirmPassword(e.target.value)}
												required
											/>
										</div>
										<button type="submmit" className="btn btn-success btn-block">
											Reset Password
										</button>
									</form>
								</div>
							</div>
							<div className="col-md-2"></div>
						</div>
					</div>
					<div className="col-md-6">
						<img src="/forgot-password-login-illustration.jpg" alt="picture" className="Image" />
					</div>
				</div>
			</div>
		</>
	);
}

export default ResetPassword;
